INSERT INTO noticias(id,name,autor_id,fecha_publicacion,texto,imagen) VALUES (0,'VI Concurso de Ada Byron 2020',0,DATE'2020-04-01','La VI edición del consurso AdaByron es la primera competicion que se celebrara de forma online. En Sevilla se celebrará en la Escuela Técnica Superior de Ingeniería Informática de la Universidad de Sevilla, en lo que será la segunda edición sevillana, con todas las medidas de seguridad pertinentes. AdaByron es un concurso universitario que nace en la Comunidad de Madrid y que este es el segundo año que se ha abierto a otras Universidades españolas en una competición en la que se miden las habilidades y destrezas de programación de los estudiantes universitarios. Uno de los objetivos del concurso es aumentar la participación de los estudiantes de informatica, el concurso tendra problemas de todos los niveles, de modo que  puedan pasar un rato entretenido enfrentándose a problemas asequibles para sus conocimientos.','resources/images/noticias/202002071847010000.JPG');
INSERT INTO noticias(id,name,autor_id,fecha_publicacion,texto,imagen) VALUES (1,'Bienvenidos a codeUs',1,DATE'2020-01-01','¡Hola a todos!, y bienvenidos a codeUs somos un grupo de estudiantes de la universidad de Sevilla que hemos decidido crear esta página para animar a todos aquellos alumnos que quieran meterse de lleno en la programación competitiva. Esperamos, junto a vosotros, hacer de codeUS una gran comunidad para todos los adictos a resolver problemas','resources/images/noticias/2020122317841918000000.jpg');
INSERT INTO noticias(id,name,autor_id,fecha_publicacion,texto,imagen) VALUES (2,'VII Concurso de Ada Byron 2021',1,DATE'2021-04-01','La VII edición del consurso AdaByron es la primera competicion que se celebrara de forma online. En Sevilla se celebrará en la Escuela Técnica Superior de Ingeniería Informática de la Universidad de Sevilla, en lo que será la tercera edición sevillana, con todas las medidas de seguridad pertinentes. AdaByron es un concurso universitario que nace en la Comunidad de Madrid y que este es el segundo año que se ha abierto a otras Universidades españolas en una competición en la que se miden las habilidades y destrezas de programación de los estudiantes universitarios. Uno de los objetivos del concurso es aumentar la participación de los estudiantes de informatica, el concurso tendra problemas de todos los niveles, de modo que  puedan pasar un rato entretenido enfrentándose a problemas asequibles para sus conocimientos.','resources/images/noticias/202002071848010200.JPG');
